import React from "react";

const Progress = () => {
  const [submitMessage, setSubmitMessage] = React.useState("");

  const handleSubmit = (event) => {
    event.preventDefault();
    setSubmitMessage("Your progress chart will be available in 24 hours");
  };
  return (
    <div style={{width: '50%', height: '80%', marginLeft: '200px', marginTop: '100px'}}>
      <form>
        <div style={{backgroundColor: 'beige', margin: '5px 0 50px 0'}}>
        <span><label>Name:</label>
        <input type="text" placeholder="Name" required></input></span>
        <label>Email:</label>
        <input type="text" placeholder="Email" required></input>
        <label>Cours ID:</label>
        <input type="text" placeholder="ID" required></input>
        <label>Courses:</label>
        <select style={{padding: '5px'}}>
          <option value="Coding">Coding</option>
          <option value="DataScience">Data Science</option>
          <option value="Devops">DevOps</option>
          <option value="UPSC">UPSC</option>
        </select>
        </div>
        <button type="submit" style={{ color: "green", width: '80px' }} onClick={handleSubmit}>
          Submit
        </button>
        {submitMessage !== "" ? <div>{setSubmitMessage}</div> : null}
      </form>
    </div>
  );
};
export default Progress;
